import React from "react";
import ReactDOM from "react-dom";
import "./SuggestionCard.css";
import star from "../assets/star.png";

const Suggestion_card = (props) => {

    const starList = [1, 2, 3, 4, 5];
    const [rating, setRating] = React.useState(0);

    const handleStarHover = (index) => {
        setRating(index);
    }


    return (
        <div className="suggestion_card">
            <div>
                <p className="suggestion_card_description">{props.text}</p>
            </div>

            <div>
                <p>Rankings: {rating}</p>
                <select id="selection-list" on>
                    <option id="first-selection" value="growth">Growth</option>
                    <option value="0">Impermanence</option>
                    <option value="neutralizing">Neutralizing</option>
                    <option value="optimism">Optimism</option>
                    <option value="self_affirmation">Self-Affirmation</option>
                    <option value="thankfulness">Thankfulness</option>
                </select>
            </div>
        </div>
        
    );
}

export default Suggestion_card;
